orderController.prototype.formatMoney = function(number, decPlaces, decSep, thouSep) {
	decPlaces = isNaN(decPlaces = Math.abs(decPlaces)) ? 2 : decPlaces,
	decSep = typeof decSep === "undefined" ? "." : decSep;
	thouSep = typeof thouSep === "undefined" ? "," : thouSep;
	var sign = number < 0 ? "-" : "";
	var i = String(parseInt(number = Math.abs(Number(number) || 0).toFixed(decPlaces)));
	var j = (j = i.length) > 3 ? j % 3 : 0;
	return sign +
		(j ? i.substr(0, j) + thouSep : "") +
		i.substr(j).replace(/(\decSep{3})(?=\decSep)/g, "$1" + thouSep) +
		(decPlaces ? decSep + Math.abs(number - i).toFixed(decPlaces).slice(2) : "");
}

orderController.prototype.getOrderFormData = function(order) {
	var map = {};
	$(".delivery_form input, .delivery_form textarea, .delivery_form select").each(function() {
		var val = $(this).val();
		if ($(this).hasClass('checkbox-assembly')) {
			if (!$(this).prop('checked')) {
				val = '';
			}
		}
		map[$(this).attr("name")] = val;
	});
	$(".kkb_basket-list input").each(function() {
		var val = $(this).val();
		if ($(this).hasClass('product-assembly')) {
			if (!$(this).prop('checked')) {
				val = '';
			}
		}
		if ($(this).attr("name")) {
			map[$(this).attr("name")] = val;
		}
	});
	$(".payment_form input").each(function() {
		var val = $(this).val();
		if (val) {
			map[$(this).attr("name")] = val;
		}
	});
	$(".contacts_form input, .contacts_form textarea, .contacts_form select ").each(function() {
		var val = $(this).val();
		if (val) {
			map[$(this).attr("name")] = val;
		}
	});

	map['available_deliveries'] = [];
	$('.itc_delivery_button').each(function(){
		let deliveryAvaiableId = $(this).data('deliveryid');
		map['available_deliveries'].push(deliveryAvaiableId);
	});

	//var orderSend = {...order, ...map};
    var orderSend = Object.assign({}, order, map);
	return orderSend;
}

orderController.prototype.updateOrderTemplate = function(externalData, basketElementId, refreshAjax, onlyRightBlock) {
    
	var self = this;
	var buyerStore = $('.kkb_store-address__item_active').data('id');

	externalData['EXTRA_CONTACT'] = $('.kkb_add-recipient__icon').hasClass('kkb_add-recipient__icon_active') ? 'Y' : '';
    if (externalData['DELIVERY_ID']) {
        if (self.params['SAMOVIVOZ_ID'] != externalData['DELIVERY_ID']) {
            buyerStore = '';
        }
    }
	var isBasketMode = $('.itc-basket-anchor').length ? 'Y' : '';
	$.ajax({
		type: "POST",
		url: "/ajax/order/getOrderTemplate.php",
		data : {is_ajax: 'Y', refreshAjax: refreshAjax, externalData: externalData, BUYER_STORE: buyerStore, BASKET_VERSION: isBasketMode},
		success:function(data){

            try {
                var jsonResult = JSON.parse(data);
                if (jsonResult['redirect']) {
                    window.location.href = jsonResult['redirect'];
                }
            } catch (e) {
                if (!onlyRightBlock) {
                    $('.order_wrapper').html(data);
                    $('.js-input-clear').trigger('initClearInput');
                    if($(data).find('.kkb_basket__item-info_active').length) {
                        $('html, body').animate({
                           scrollTop: $('.order_wrapper').offset().top - 45
                        }, 600);
                        $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
                    }
                    if (externalData['CURRENT_STEP'] && (externalData['CURRENT_STEP'] != 'DELIVERY')) {
                        self.adjustDeliveryShortHtml();
                    }
                    if (externalData['ITC_AJAX_ERROR']) {
                        if (externalData['ITC_AJAX_ERROR']['TYPE'] == 'ENOUGH_QUANT') {
                            $('.itc_quant_error_text[data-basketelement=' + basketElementId + ']').each(function(){
                                $(this).html("Вы заказывали " + externalData['ITC_AJAX_ERROR']['REQUESTED'] + ". На текущий момент доступно " + externalData['ITC_AJAX_ERROR']['AVAILABLE']);
                                $(this).show();
                            });
                            $('.itc_quant_error_sign[data-basketelement=' + basketElementId + ']').each(function(){
                                $(this).show();
                            });
                            $('.kkb_basket-number__info[data-basketelement=' + basketElementId + ']').each(function(){
                                $(this).html("Вы заказывали " + externalData['ITC_AJAX_ERROR']['REQUESTED'] + ". На текущий момент доступно " + externalData['ITC_AJAX_ERROR']['AVAILABLE']);
                                $(this).show();
                                $(this).css('margin-top', '10px');
                            });
                        }
                    }
                    $('.itc-loading-order').fadeOut();
                } else {
                    $('.kkb_basket-right').html(data);
                    if ($('.kkb_checkout-block').length != 0) {
                        $('.kkb_basket-normal').addClass('kkb_basket-fixed');
                    }
                }
            } 
            self.showTooltip();//чтобы тултипы появлялись снова после удаления элемента
		}
    });
}

orderController.prototype.refreshBasketAfterItem = function(data, basketElementId, refreshTopBasketAfter) {
	var self = this;
	$('.itc-loading-order').fadeIn();
	var basketData = data;
	var signedParamsString = $('#signedParamsString').html();
	var order = {};
	order['sessid']	= BX.bitrix_sessid();
	order['action']	= 'refreshOrderAjax';
	order['location_type']	= 'code';
	var orderSend = this.getOrderFormData(order);
	//$.ajax({
	//	type: "POST",
	//	url: "/local/components/itconstruct/sale.order.ajax/ajax.php",
	//	data : {signedParamsString: signedParamsString, order: orderSend, via_ajax: 'Y', SITE_ID: 's1', action: 'refreshOrderAjax'},
	//	success:function(data){
			//var parsed = data['order'] ? data['order'] : JSON.parse(data);
			//if (parsed['redirect']) {
			//	window.location.href = parsed['redirect'];
			//}
			
			//var sendData = {...data, ...basketData, ...orderSend};
            var sendData = Object.assign({}, data, basketData, orderSend);
            sendData['CURRENT_STEP'] = 'BASKET';
			if (refreshTopBasketAfter) {
				self.reloadTopBasket('wish', $('#basket_line'), 200, 5000, 'N');
			}

			self.updateOrderTemplate(sendData, basketElementId, true);
	//	}
	//});
}

orderController.prototype.reloadTopBasket = function(action, basketWindow, speed, delay, slideDown, item){
	var self = this;
	var obj = {
        "PARAMS": $('#top_basket_params').val(),
        "ACTION": action,
        'sessid': BX.bitrix_sessid()
    };
	if(typeof item !== "undefined" ) {
		obj.delete_top_item='Y';
		obj.delete_top_item_id=item.data('id');
	}
	$.post("/ajax/show_basket_popup.php", obj, $.proxy(function(data) {
		$(basketWindow).html(data);
		if(typeof item !== "undefined" ){
			self.getActualBasket(item.closest('tr').attr('data-iblockid'));
		}
	}))
}

orderController.prototype.getActualBasket = function(iblockID){
	var data = '';
	if(typeof iblockID !== "undefined"){
		data = {"iblockID":iblockID}
	}
	$.ajax({
		type: "GET",
		url: "/ajax/actualBasket.php",
		data: data,
		success: function(data){
			if(!$('.js_ajax').length) {
				$('body').append('<div class="js_ajax"></div>');
            }
			$('.js_ajax').html(data);
		}
	});
}
	
orderController.prototype.registerQuantityHandler = function() {
	var self = this; 
	$(document).off('change', '.itc_product_basket_quant');
	$(document).on('change', '.itc_product_basket_quant', function() {
        var newQuantity = $(this).val();
		var basketElementId = $(this).data('basketelement');
		var fill_prop = {};
		fill_prop['site_id'] = 's1';
		fill_prop['action_var'] = 'action';
		fill_prop['select_props'] = ['NAME', 'PROPS','DELETE','DELAY','PRICE','QUANTITY','SUM'];
		fill_prop['offers_props'] = ['SIZES', 'COLOR_REF'];
		fill_prop['quantity_float'] = 'N';
		fill_prop['price_vat_show_value'] = 'N';
		fill_prop['hide_coupon'] = 'Y';
		fill_prop['use_prepayment'] = 'N';
		fill_prop['action'] = 'recalculate';
		fill_prop['QUANTITY_' + basketElementId] = newQuantity;
        $('.itc-loading-order').fadeIn();
		$.ajax({
			type: "POST",
			url: "/local/components/itconstruct/sale.order.ajax/ajax_basket.php",
			data : fill_prop,
			success:function(data){
				self.refreshBasketAfterItem(data, basketElementId);
			}
		});
	});
}

orderController.prototype.showTooltip = function () {
    $('.kkb_basket-button__icon').hover(function () {
        var classTest = $('body').hasClass('mobile');
        if (classTest == false) {
            var $contentTolltip = '<div class="kkb_content-item__tolltip"></div>';
            $('body').append($contentTolltip);
            var $Text1 = 'Удалить';
            var $Text2 = 'Отложить на потом';

            var $contentItemTollTip = $('.kkb_content-item__tolltip'); // Позиция tolltip

            $contentItemTollTip.css({
                top: $(this).offset().top - 50,
                left: $(this).offset().left - 67,
                'transition-duration': '350ms',
                'animation-duration': '350ms',
                'opacity': '1'
            });

            $contentItemTollTip.addClass('kkb_content-item__tolltip_active');
            if ($(this).hasClass('kkb_basket-button__icon_times') == true) {
                $contentItemTollTip.text($Text1);
            }
            if ($(this).hasClass('kkb_basket-button__icon_heart') == true) {
                $contentItemTollTip.text($Text2);
            }
        }
    }, function () {
        $('.kkb_content-item__tolltip').remove();
    }); // tooltip END
}

