orderController.prototype.checkingInputDelivery = function(){
    const APARTMENT = $('input[name="PROPERTY_APARTMENT"]').val();
    const PORCH = $('input[name="PROPERTY_PORCH"]').val();
    const FLOOR = $('input[name="PROPERTY_FLOOR"]').val();
    const ADDRESS = $('#full_address').hasClass('itc_error');
    const DATA_DELIV = $('.kkb_table-dataTime').val();
    const LIFT = $('input[name="PROPERTY_LIFT"]').val();
    var resultVerification = false;
    //проверяем все ли поля доставки заполнены
    if(!ADDRESS && APARTMENT && PORCH && FLOOR && DATA_DELIV && LIFT){
        resultVerification = true;
    }
    return resultVerification;
}
orderController.prototype.buttonBlockedIfNotStep = function(){
    var self = this;
    const delivery_form = $('.delivery_form').hasClass('readyForChange');
    const payment_form = $('.payment_form').hasClass('readyForChange');
    const contacts_form = $('.contacts_form').hasClass('readyForChange');
    var resultVerification = false;
    //пройдены ли все шаги
    if(delivery_form && payment_form && contacts_form){
        resultVerification = true;
    }
    return resultVerification;
}

