orderController.prototype.registerOrderHandler = function() {
	var self = this;
    var scrollFlag = true;
    $(document).off('click', '.kkb_regulations__checkbox');
	$(document).on('click', '.kkb_regulations__checkbox', function() {
        if (!$(this).parent().hasClass('kkb_regulations__checkbox_blocked')){
            $(this).toggleClass('kkb_regulations__checkbox_active');
            if (!$(this).hasClass('kkb_regulations__checkbox_active') && !self.buttonBlockedIfNotStep() || //нет чекбокса и шаги не пройдены
                $(this).hasClass('kkb_regulations__checkbox_active') && !self.buttonBlockedIfNotStep() || //есть чекбокс, но шаги не пройдены
                $('.kkb_checkout-button').hasClass('kkb_checkout-button_complete') && !$(this).hasClass('kkb_regulations__checkbox_active')){ //кнопка завершить и нет чекбокса
                     $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
            }
            else {
                $('.kkb_checkout-button').removeClass('kkb_checkout-button_blocked');
            }
        }
    }); 
	$(document).off('click', '.kkb_checkout-button');
	$(document).on('click', '.kkb_checkout-button', function() {
		if ($(this).hasClass('kkb_checkout-button_complete')) {
            var $error = false;
            var $inputCheck = $('.kkb_block-input_check');
            $.each($inputCheck,function (){ 
                var parent = $(this).parent();
                if ($(this).val().length === 0){
                    $(this).addClass('kkb_error-border_active');
                    //$(this).closest('.kkb_item-element').find('.kkb_select-block').addClass('kkb_error-border_active');
                    $(this).closest('.kkb_item-element').find('.kkb_error-info').addClass('kkb_error-info_active');
                    if ($(this).hasClass('kkb_table-dataTime')){
                        $(this).next().addClass('kkb_error-border_active');
                    }
                    var $thisButtonNext = $(this).closest('.kkb_checkout__content').next().children('.kkb_button-next');
                    if ($thisButtonNext.hasClass('kkb_button-next_mobile')){
                        $thisButtonNext.addClass('kkb_button_animation');
                        setTimeout(function () {
                            // $('html, body').animate({
                            //     scrollTop: $this.offset().top - 200
                            // }, 600);
                            $thisButtonNext.removeClass('kkb_button_animation');
                        },500);
                    }
                    $error = true;
                }
            });
            if ($error) {
                return false;
            }
			var signedParamsString = $('#signedParamsString').html();
			var order = {};	
			order['sessid']	= BX.bitrix_sessid();
			order['action']	= 'saveOrderAjax';
			order['location_type']	= 'code';
			order['BUYER_STORE'] = $('.kkb_store-address__item_active').data('id');
			var orderSend = self.getOrderFormData(order);
			$('.itc-loading-order').fadeIn();
			$.ajax({
				type: "POST",
				url: "/local/components/itconstruct/sale.order.ajax/ajax.php",
				data : {signedParamsString: signedParamsString, order: orderSend, via_ajax: 'Y', SITE_ID: 's1', action: 'refreshOrderAjax'},
				success:function(data) {
					if (data['order']) {
						if (data['order']['REDIRECT_URL']) {
							window.location.href = data['order']['REDIRECT_URL'];
						} else if (data['order']['ERROR']['DELIVERY_INTERVAL']) {
							$('.delivery-error-box').html(data['order']['ERROR']['DELIVERY_INTERVAL']);
							$('.itc-loading-order').fadeOut();
						} else if (data['order']['ERROR']['DELIVERY_FLOOR']) {
							$('.delivery-error-box').html(data['order']['ERROR']['DELIVERY_FLOOR']);
							$('.itc-loading-order').fadeOut();
						} else if (data['order']['ERROR']['PROPERTY']) {
							var errorHtml = "";
							for (var i in data['order']['ERROR']['PROPERTY']) {
								errorHtml += data['order']['ERROR']['PROPERTY'][i] + "</br>";
							}
							$('.delivery-error-box').html(errorHtml);
							$('.itc-loading-order').fadeOut();
						} 
					}
				}
			});
		} else {
            var orderMode = $(this).data('order') == 'Y' ? true : false;
            var authMode = $(this).data('auth') == 'Y' ? true : false;
            if (orderMode) {
                window.location.href = "/order/";
            } else {
                if (!authMode) {
                    if (!$(this).hasClass('kkb_checkout-button_blocked')){
                       var $checkoutBlock = $('.kkb_checkout-block');
                       $('.kkb_checkout-block').slideDown(300);
                       if ($('.kkb_checkout-block').length !== 0) {
                            //если клик был по элементам "+-1, отложить, удалить", то надо остаться тут же
                            $('.kkb_basket-button__icon_heart, .kkb_basket-number__button_minus, .kkb_basket-number__button_plus, .itc_delete_item, .kkb_basket-button__list-trash, .kkb_basket-button__list-heart').click(function(){
                                self.isClickBasket = true;
                            })
                            if(self.isClickBasket && !$('.kkb_checkout-button').hasClass('kkb_checkout-button_blocked')){
                                $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
                            }
                            if(!$('.kkb_basket__item-info_active').length) {
                                if (scrollFlag && !self.isClickBasket) {
                                    $('html, body').animate({
                                        scrollTop: $('.kkb_checkout-block').offset().top - 25
                                    }, 600);
                                    $(this).addClass('kkb_checkout-button_blocked');   
                                    scrollFlag = false; 
                                }
                            }
                            else if($('.kkb_basket__item-info_active').length) {
                                $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
                            } 
                       }
                    }
                }
            }
        }
    });
}

orderController.prototype.simpleUpdate = function(extraConfig) {
	var self = this;
	var signedParamsString = $('#signedParamsString').html();
	var order = {};	
	order['sessid']	= BX.bitrix_sessid();
	order['action']	= 'refreshOrderAjax';
	order['location_type']	= 'code';
	var orderSend = self.getOrderFormData(order);
	if (extraConfig) {
		//orderSend = {...orderSend, ...extraConfig};
        orderSend = Object.assign({}, orderSend, extraConfig);
	}
    if (!orderSend['CUSTOM_ACTION']) {
        $('.itc-loading-order').fadeIn();
    }
    var data = {};

    if (orderSend['CUSTOM_ACTION'] == 'ONLY_DA_CHECK') {
        $.ajax({
        	type: "POST",
        	url: "/local/components/itconstruct/sale.order.ajax/ajax.php",
        	data : {signedParamsString: signedParamsString, order: orderSend, via_ajax: 'Y', SITE_ID: 's1', action: 'refreshOrderAjax'},
        	success:function(data){
                data['CURRENT_STEP'] = 'DELIVERY';				
                //var sendData = {...data, ...orderSend};
                var sendData = Object.assign({}, data, orderSend);
                if (!orderSend['CUSTOM_ACTION']) {    
                    self.updateOrderTemplate(sendData, false, true);
                } else if (orderSend['CUSTOM_ACTION'] == 'ONLY_DA_CHECK') {
                    if (typeof sendData['order'] != 'undefined') {
                        self.params['ALLOW_DELIVERY'] = sendData['order']['ALLOW_DELIVERY']; 
                        self.params['ALLOW_ASSEMBLY'] = sendData['order']['ALLOW_ASSEMBLY']; 
                        self.params['ADDRESS_FILLED'] = sendData['order']['ADDRESS_FILLED']; 
                        self.params['EXPRESS_STORE_AVAILABLE'] = sendData['order']['EXPRESS_STORE_AVAILABLE'];
                    }
                    self.registerDeliveryPopupHandler();
                    if (self.params['EXPRESS_STORE_AVAILABLE'] || self.params['ASSEMBLY_SELECTED']) {
                        self.processAssemblyWarning()
                    }
                } else if (orderSend['CUSTOM_ACTION'] == 'SUMMARY_REFRESH') {
                    self.updateOrderTemplate(sendData, false, true, true);
                }
        	}
        });
    } else {
        data['CURRENT_STEP'] = 'DELIVERY';				
        //var sendData = {...data, ...orderSend};
        var sendData = Object.assign({}, data, orderSend);
        if (!orderSend['CUSTOM_ACTION']) {    
            self.updateOrderTemplate(sendData, false, true);
        } else if (orderSend['CUSTOM_ACTION'] == 'ONLY_DA_CHECK') {
            if (typeof sendData['order'] != 'undefined') {
                self.params['ALLOW_DELIVERY'] = sendData['order']['ALLOW_DELIVERY']; 
            }
            self.registerDeliveryPopupHandler();
            if (self.params['EXPRESS_STORE_AVAILABLE']) {
                self.processAssemblyWarning()
            }
        } else if (orderSend['CUSTOM_ACTION'] == 'SUMMARY_REFRESH') {
            self.updateOrderTemplate(sendData, false, true, true);
        }
    }
}

