orderController.prototype.registerDeliveryPopupHandler = function() {
	var self = this;
	if (self.params['ALLOW_DELIVERY'] == 'N') {
        if (!self.params['EXPRESS_STORE_AVAILABLE']) {
            $('#itc-popup-head').html('Внимание');
            $('#itc-popup-body').html('По данному адресу доставка недоступна');
            $('.itc-delivery-next').hide();
        } else {
            $('#itc-popup-head').html('Внимание');
            $('#itc-popup-body').html('Экспресс-доставка из выбранного Вами магазина недоступна.');
            var textWrap = BX.create('div', {
                text: 'Вы можете заказать экспресс-доставку из следующих магазинов:'
            });
            var children = BX.create('div');
            for (var i in this.params['EXPRESS_STORE_AVAILABLE']) {
                var child = BX.create('a', {
                    text: this.params['EXPRESS_STORE_AVAILABLE'][i]['ADDRESS'],
                    attrs: {
                        href: this.params['EXPRESS_STORE_AVAILABLE'][i]['LINK']
                    }
                });
                
                children.appendChild(child);
            }
            var buttons = BX.create('div');
            buttons.appendChild(children);
            textWrap.appendChild(buttons);
			BX('itc-popup-body').appendChild(textWrap);
            $('.itc-delivery-next').hide();
        }
		self.showPopup();
	} else {
        $('.itc-delivery-next').show();
    }
}

