orderController.prototype.updateFloorLiftRelation = function(floor, lift, runUpdate) {
    
    if (this.params['BASKET_VERSION']) {
        return false;
    }
    
    if (typeof lift == 'undefined') {
       lift = '';
    }
    
    if (typeof floor == 'undefined') {
        floor = $('.kkb-input-floor').val();
    }
    BX.ajax({
        url: '/ajax/order/floorController.php',
        method: 'POST',
        dataType: 'json',
        data: {floor: floor, lift: lift},
        onsuccess: function(data){
            if (data['liftHtml']) {
               
                $('.order_lift_property').html(data['liftHtml']);
                $('.order_lift_property').show();
            } else {
                $('.order_lift_property').hide();
                $('.kkb-input-lift').removeClass('is_required');
            }
            if (data['liftServiceHtml']) {
                $('.order_lift_service').html(data['liftServiceHtml']);
                $('.order_lift_service').show();
            } else {
                $('.order_lift_service').hide();
            } 
            if(data['LIFT_REQUIRED']){
                setTimeout(function(){
                    $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
                }, 800)
            }
        }
    });
    if (runUpdate) {
        this.simpleUpdate({'CUSTOM_ACTION' : 'SUMMARY_REFRESH'});
    }
    
}

