orderController.prototype.adjustDeliveryShortHtml = function() {
    var self = this;
	var $checkoutBox = $('.itc-delivery-next').closest('.kkb_checkout-box');
	var $infoBox = $checkoutBox.find('.kkb_checkout-box__info');
	var $checkoutAddress = $('.kkb_checkout-box__address');
	if ($checkoutBox.find('.kkb_checkout__content').hasClass('kkb_checkout__content_delivery')){
		var $checkoutBoxTitle = $checkoutBox.find('.kkb_checkout-box__title-main');
		var $checkoutTitle = $checkoutBoxTitle.children('.checkout_title');
		if (!$checkoutBox.find('.kkb_step-3').hasClass('kkb_hidden') && $('.kkb_step-3').length) {
			var $buttonTitle = $checkoutBox.find('.kkb_step-3').children('.kkb_step__title').text();
			$checkoutTitle.text($buttonTitle)
		} else {
			var $activeButtonStep = $checkoutBox.find('.kkb_checkout__button_active');
			$.each($activeButtonStep,function () {
				var $buttonTitle = $(this).find('.kkb_checkout__title').text();
				$checkoutTitle.text($buttonTitle);
				var $priceDelivery = $(this).find('.kbb_checkout__price').text().trim();
				$infoBox.find('.kkb_checkout-box__delivery-price').text($priceDelivery);
                if (self.params['COURIER_ID'] != $(this).data('deliveryid')) {
                    var dateDelivery = $(this).find('.itc_delivery_date').text().trim();
                    $('#itc_delivery_date').text(dateDelivery);
                } else {
                    $('#itc_delivery_date').text('');
                }
			});
		}
	}
    self.activeStoreAddress();
	var $stepBox = $checkoutBox.find('.kkb_step-box_info');
	var $address = [];
	$infoBox.find('.kkb_info-line-template').remove();
	$.each($stepBox,function () {
		if (!$(this).hasClass('kkb_hidden')){
			$.each($(this).find('.kkb_block-input'),function () {
                if ($(this).hasClass('kkb_record-separately')) {
                    if ($(this).val().length > 0) {
                        if ($(this).hasClass('kkb-input-full-address')) {
                            $address.push(' ' + $(this).val()+'');
                        }
                        if ($(this).hasClass('kkb_input-numberHome')){
                            $address.push(' кв./оф. '+$(this).val()+'');
                        }
                        if ($(this).hasClass('kkb-input-porch')){
                            $address.push(' под. '+$(this).val()+'');
                        }
                        if ($(this).hasClass('kkb-input-floor')) {
                            $address.push(' этаж '+$(this).val());
                        }
                        if ($(this).hasClass('kkb-input-lift')){
                            var $liftText;
                            if ($(this).val() === 'Да'){
                                $liftText = ' лифт есть';
                                $address.push($liftText);
                            }
                        }
                        if ($(this).hasClass('kkb-input-city') && $address.length == 0) {
                            $address.push($(this).val());
                        }
                    }
                    $checkoutAddress.text($address);
                    $('.checkout_title').html($('.kkb_checkout__button_active .kkb_checkout__title').html());
                    $('.kkb_checkout-box__delivery-price').html($('.kkb_checkout__button_active .kbb_checkout__price_show').attr('data-delivery-price'));
                } else {
                    if (!$(this).hasClass('kkb_block-input-add')) {
                        if ($(this).val().length > 0) {
                            if (!$(this).hasClass('passport-data')){
                                var $thisVal = $(this).val();
                                var $thisTitle = $(this).closest('.kkb_item-element').find('.kkb_item-element__title').text();
                                if ($(this).hasClass('kkb_block-textarea') && $(this).val().length > 35){
                                    var text = $(this).val().substring(0, 35);
                                    var lastIndex = text.lastIndexOf('');
                                    text = text.substring(0, lastIndex) + '...';
                                    $thisVal = text;
                                }
                                var $template =
                                '<div class="kkb_checkout-box__info-line kkb_info-line-template">' +
                                '<div class="kkb_checkout-box__info-title">' + $thisTitle + '</div>' +
                                '<div class="kkb_checkout-box__info-text">' + $thisVal + '</div>' +
                                '</div>';
                                $infoBox.append($template);
                            }
                        }
                    } else {
                        self.addRecipient();
                    }
                }
			});
			var $passportData = [];
			var $thisTitle = $(this).find('.passport-data').closest('.kkb_block-item__line').prev().children().text();
            var passportFilled = true;
			$.each($(this).find('.passport-data'),function () {
                if (!$(this).val()) {
                    passportFilled = false;
                }
				$passportData.push(' ' +$(this).attr('placeholder')+ ' : ' +$(this).val()+ ' ');
			});
            if (!passportFilled) {
                $passportData = '';
            }
			var $template =
				'<div class="kkb_checkout-box__info-line kkb_info-line-template">' +
				'<div class="kkb_checkout-box__info-title">' + $thisTitle + '</div>' +
				'<div class="kkb_checkout-box__info-text">' + $passportData + '</div>' +
				'</div>';
			$infoBox.append($template);
		}
	});
	$infoBox.slideDown(500).animate({'opacity' : '1'},300);
}

orderController.prototype.getParameterByName = function(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, '\\$&');
    var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
}

orderController.prototype.initFullAddressDadataHandler = function(self) {
    var curval = self.fullAddress.val();
    self.fullAddress.suggestions({
		token: self.params['dadataSettings']['token'],
        type: "ADDRESS",
        count: 10,
        scrollOnFocus: false,
        bounds: "city-settlement-house",
        formatSelected: function(suggestion) {
            var value = suggestion['value'];
            if (suggestion['data']['postal_code']) {
                var split = value.split(', ');
                self.removeElement(split, suggestion['data']['postal_code']);
                value = split.join(', ');
            }
            return value;
        },
        onSearchError: function(query, jqXHR, textStatus, errorThrown) {
            self.fullAddress.val('');
            $('#full_address_hidden').val('');
            self.fullAddress.addClass('kkb_error-border_active');
        },
		onSelect: function(suggestion, changed) {
			if (changed || (curval != suggestion['value']) || (!suggestion['data']['house'])) {
				var selectedCity = suggestion['data']['settlement'] ? suggestion['data']['settlement'] : suggestion['data']['city'];
				var selectedArea = suggestion['data']['area'] ? suggestion['data']['area'] + ' ' + suggestion['data']['area_type_full'] : '';
				var splitRegion = suggestion['data']['region'].split(' ');
				suggestion['data']['region'] = splitRegion[0];
				var selectedRegion = suggestion['data']['region'] + ' ' + suggestion['data']['region_type_full'];
				var selectedRegionReverse = suggestion['data']['region_type_full'] + ' ' + suggestion['data']['region'];
				var unrestrictedSettlement = suggestion['data']['settlement'] ? suggestion['data']['settlement'] : '';
                var unrestrictedCity = suggestion['data']['city'] ? suggestion['data']['city'] : '';
                var value = suggestion['value'];
                if (suggestion['data']['postal_code']) {
                    var split = value.split(', ');
                    self.removeElement(split, suggestion['data']['postal_code']);
                    value = split.join(', ');
                }
                var hiddenAddress = '';
                if (suggestion['unrestricted_value']) {
                    var split = suggestion['unrestricted_value'].split(', ');
                    self.removeElement(split, suggestion['data']['postal_code']);
                    var hiddenAddress = split.join(', ');
                    $('#full_address_hidden').val(hiddenAddress);
                }
                self.wipeAddressInputs();
                BX.ajax({
					url: '/include/ajax/getDomenByCityName.php',
					method: 'POST',
					dataType: 'json',
					data: {
                        cityName : selectedCity, 
                        areaName : selectedArea, 
                        regionName: selectedRegion, 
                        reverseRegionName: selectedRegionReverse, 
                        unrestrictedValue: value,
                        dadataHidden: hiddenAddress,
                        unrestrictedSettlement: unrestrictedSettlement,
                        unrestrictedCity: unrestrictedCity,
                    },
					onsuccess: function(url){
						if (url) {
                            var redirectCity = self.getParameterByName('CITY_NAME', url);
                            var checkCity = self.params['cityName'];
                            if (redirectCity != checkCity) {
                                window.location.href = url;
                            } else {
                                BX.ajax({
                                    url: '/ajax/order/setOtherStoreSession.php',
                                    method: 'POST',
                                    dataType: 'json',
                                    data: {
                                        cityName : checkCity, 
                                    }
                                });
                                $('#itc-is-house').val("N");
                                if (suggestion['data']['house']) {
                                    $('#itc_full_address_error').hide();
                                    $('#full_address').removeClass('itc_error');
                                    $('#full_address').removeClass('kkb_error-border_active');
                                    $('#house').val('');
                                    self.simpleUpdate({'CUSTOM_ACTION' : 'ONLY_DA_CHECK'});
                                } else {
                                    $('#itc_full_address_error').show();
                                    $('#full_address').addClass('itc_error');
                                    $('#full_address').addClass('kkb_error-border_active');                                    
                                }
                            }
						} else {
							$('#itc-is-house').val("N");
                            if (suggestion['data']['house']) {
                                $('#itc_full_address_error').hide();
                                $('#full_address').removeClass('itc_error');
                                $('#full_address').removeClass('kkb_error-border_active');
                                $('#house').val('');
                                self.simpleUpdate({'CUSTOM_ACTION' : 'ONLY_DA_CHECK'});
                            } else {
                                $('#itc_full_address_error').show();
                                $('#full_address').addClass('itc_error');
                                $('#full_address').addClass('kkb_error-border_active');
                            }
						}
					}
				});
			}
		},
        onSelectNothing: function(query) {
            self.fullAddress.val('');
            $('#full_address_hidden').val('');
            $('#itc_full_address_error').show();
            $('#full_address').addClass('itc_error');
            $('#full_address').addClass('kkb_error-border_active');
        }             
    }); 
    $(document).off('click', '.js-input-clear__button');
	$(document).on('click', '.js-input-clear__button', function() {
        $('#full_address_hidden').val('');
        $('#full_address').addClass('itc_error');
        $('#full_address').addClass('kkb_error-border_active');
	});
}

orderController.prototype.removeElement = function(array, elem) {
    var index = array.indexOf(elem);
    if (index > -1) {
        array.splice(index, 1);
    }
}

