orderController.prototype.initStreetDadataHandler = function(self) {
    if (self.params['CITY_NAME']) {
        var cityConstraints = {
            label: "",
            locations: [
                {'city': self.params['CITY_NAME']},
                {'settlement': self.params['CITY_NAME']}
            ],
            deletable: true
        }
	} else {
		var cityConstraints = self.city;
	}
    
	self.street.suggestions({
		token: self.params['dadataSettings']['token'],
        type: "ADDRESS",
        scrollOnFocus: false,
		bounds: "street",
		constraints: cityConstraints,
        formatResult: function(value, currentValue, suggestion, options) {
            var extraPart = (suggestion['data']['street_type_full'] != 'улица') ? ' ' + suggestion['data']['street_type_full'] : '';
            var settlementPart = suggestion['data']['settlement_with_type'] ? suggestion['data']['settlement_with_type'] + ', ' : '';
            value = suggestion['data']['street'] ? settlementPart + suggestion['data']['street'] + extraPart : settlementPart + value;
            return value;
        },
		formatSelected: function(suggestion) {	
            var extraPart = (suggestion['data']['street_type_full'] != 'улица') ? ' ' + suggestion['data']['street_type_full'] : '';
            var settlementPart = suggestion['data']['settlement_with_type'] ? suggestion['data']['settlement_with_type'] + ', ' : '';
            suggestion['value'] = suggestion['data']['street'] ? settlementPart + suggestion['data']['street'] + extraPart : settlementPart + suggestion['value'];
		},
		onSelect: function(suggestion, changed) {
			if (changed) {
                var settlementPart = suggestion['data']['settlement_with_type'] ? suggestion['data']['settlement_with_type'] + ', ' : '';
				$('#itc-is-house').val("N");
				self.wipeAddressInputs();
				self.house.val("");
                self.params['EXTERNAL_DATA']['PROPERTY_DELIVERY_STREET'] = settlementPart + suggestion['data']['street'];
                self.params['EXTERNAL_DATA']['KLADR_ID'] = suggestion['data']['fias_id'];
				self.initDadata();
			} 
		},
        onSelectNothing: function(query) {
            self.street.val('');
        }
	});
}

orderController.prototype.initDadata = function() {
    if (this.params['BASKET_VERSION']) {
        return false;
    }
	var self = this;
	var token = this.params['dadataSettings']['token'];
	self.city   = $("#city");
	self.street = $("#street");
	self.house  = $("#house");
    self.fullAddress = $("#full_address");
	var $tkCity = $("#tk_city");
	$tkCity.suggestions({
		token: token,
		type: "ADDRESS",
		bounds: "city-settlement",
		onSelect: function(suggestion, changed) {
			if (changed) {
				var selectedCity = suggestion['data']['settlement'] ? suggestion['data']['settlement'] : suggestion['data']['city'];
				var selectedArea = suggestion['data']['area'] ? suggestion['data']['area'] + ' ' + suggestion['data']['area_type_full'] : '';
				var splitRegion = suggestion['data']['region'].split(' ');
				suggestion['data']['region'] = splitRegion[0];
				var selectedRegion = suggestion['data']['region'] + ' ' + suggestion['data']['region_type_full'];
				var selectedRegionReverse = suggestion['data']['region_type_full'] + ' ' + suggestion['data']['region'];
				var unrestrictedSettlement = suggestion['data']['settlement'] ? suggestion['data']['settlement'] : '';
                var unrestrictedCity = suggestion['data']['city'] ? suggestion['data']['city'] : '';
				BX.ajax({
					url: '/include/ajax/getDomenByCityName.php',
					method: 'POST',
					dataType: 'json',
					data: {
                        cityName : selectedCity, 
                        areaName : selectedArea, 
                        regionName: selectedRegion, 
                        reverseRegionName: selectedRegionReverse, 
                        unrestrictedValue: suggestion['value'],
                        unrestrictedSettlement: unrestrictedSettlement,
                        unrestrictedCity: unrestrictedCity,
                    },
					onsuccess: function(url){
						if (url) {
							window.location.href = url;
						} else {	
                            var passCityName = unrestrictedCity ? unrestrictedCity : unrestrictedSettlement;
                            BX.ajax({
                                url: '/ajax/order/setOtherStoreSession.php',
                                method: 'POST',
                                dataType: 'json',
                                data: {
                                    cityName : passCityName, 
                                }
                            });
                            $('#kkb_header .kkb_dropdown__button-title').html(passCityName);
							//self.simpleUpdate();
						}
					}
				});
			}
		},
        onSelectNothing: function(query) {
            $("#tk_city").val('');
        }
	});
    self.initFullAddressDadataHandler(self);
    //self.initCityDadataHandler(self);
	//self.initStreetDadataHandler(self);
    self.initHouseDadataHandler(self);	
}

