orderController.prototype.registerIntervalTimeHandler = function() {
	var $dateAndTimeText;
    var formatedDate;
	var intervalId;
	var self = this;
    $('.kkb_table__cell_text').hover(function () {
        if (!$(this).parent().hasClass('kkb_table__not')){
            $(this).addClass('kkb_table__cell_text_hover');
        }
    },function () {
        $(this).removeClass('kkb_table__cell_text_hover');
    });
	$(document).off('click', '.kkb_table__cell_text');
	$(document).on( "click", ".kkb_table__cell_text", function() {
        if (!$(this).parent().hasClass('kkb_table__not')){
            if (!$(this).hasClass('kkb_table__cell_text_active')){
                 $('.kkb_table__cell_text').removeClass('kkb_table__cell_text_active');
                $(this).addClass('kkb_table__cell_text_active');
                $('body').addClass('kkb_no-scroll');
                var $thisDate = $(this).closest('.kbb_table__item').find('.kkb_table__cell-title span').text();
                formatedDate = $(this).data('formated');
                var $thisTime = $(this).text();
                if ($thisDate && $thisTime !== undefined){
                    var $info = $thisDate.trim() + ' ' + $thisTime.trim();
                    $dateAndTimeText = $info;
					$('.kkb_popUp-dateTime__button').attr('data-intervalid', $(this).data('interval-id'));
                }
            }
            var $popUpButton = $('.kkb_popUp-dateTime__button');
            var $popUPButtonLine = $('.kkb_popUp-dateTime__button-line');
            if ($popUPButtonLine.hasClass('kkb_popUp-dateTime__button-line_mobile')){
                $popUPButtonLine.animate({
                    bottom: 0
                }, 300);
            }
            if ($('.kkb_table__cell_text').hasClass('kkb_table__cell_text_active')){
                $popUpButton.addClass('kkb_popUp-dateTime__button_active');
            } else {
                $popUpButton.removeClass('kkb_popUp-dateTime__button_active');
            }
        }
    });
	$(document).off('click', '.kkb_popUp-dateTime__button');
	$(document).on( "click", ".kkb_popUp-dateTime__button", function(e) {
		var isAssemble = $(this).hasClass("assemble");
        e.preventDefault();
        if ($(this).hasClass('kkb_popUp-dateTime__button_active')) {
		    var dateElement = isAssemble ? $('.kkb_item-element_date_assemble') : $('.kkb_item-element_date_regular');
		    var dataTimeElement = isAssemble ? $('.kkb_table-dataTime_assemble') : $('.kkb_table-dataTime_regular');
			var intervalIdElement = isAssemble ? $('.sborka-id') : $('.courier-interval-id');
            dateElement.text($dateAndTimeText);
            dataTimeElement.val($dateAndTimeText);
			intervalIdElement.val($('.kkb_popUp-dateTime__button').data('intervalid'));
			$('.delivery-error-box').html('');
            var $itemElementDate = $('.kkb_item-element_date');
            $itemElementDate.removeClass('kkb_error-border_active');
            $itemElementDate.next().removeClass('kkb_error-info_active');
            if (!isAssemble) {
                $('.kkb_item-element_date_assemble').text('Укажите дату сборки');
                $('.kkb_table-dataTime_assemble').val('');
                $('.kkb_table-dataTime_assemble').attr('value', '');
            }
            $('.kkb_popUp-dateTime').removeClass('transition_loaded');
            $('.kkb_popUp-dateTime').removeClass('kkb_popUp-dateTime_active');
            $('.kkb_popUp-dateTime__box').removeClass('kkb_popUp-dateTime__box_show');
            $('body').removeClass('kkb_no-scroll');
            $error = false;
            //$('.kkb_checkout__button_active .itc_delivery_date').html(formatedDate);
        }
    });
}

orderController.prototype.registerSummaryBlockSticky = function() {
    (function(){       
        if ($('.kkb_basket-normal').length) {
            var basketNormalTop = parseInt($('.kkb_basket-normal').offset().top) + 15;
            var basketNormalHeight = parseInt($('.kkb_basket-normal').outerHeight());
            $(window).scroll(function () {
               var top = parseInt($(document).scrollTop());
               var footerTop = parseInt($('footer').offset().top) - 60;
               if (top > basketNormalTop  && top < footerTop - basketNormalHeight){
                   $('.kkb_basket-normal').addClass('kkb_basket-fixed');
                   $('.kkb_basket-normal').removeClass('kkb_basket-absolute');
                } else if (top > footerTop - basketNormalHeight) {
                   $('.kkb_basket-normal').addClass('kkb_basket-absolute');
                   $('.kkb_basket-normal').removeClass('kkb_basket-fixed');
     
                } else {
                   $('.kkb_basket-normal').removeClass('kkb_basket-fixed');
                }
            });
        }
    })();
}

