orderController.prototype.nextStep = function($this) {
   
    var self = this;
    var $error = false;
    var $checkoutBox = $this.closest('.kkb_checkout-box');
    var $inputCheck = $this.find('.kkb_block-input_check');
    var $buttonChange = $checkoutBox.find('.kkb_change-checkout');
    var $infoBox = $checkoutBox.find('.kkb_checkout-box__info');
    var $description = $checkoutBox.find('.kkb_title-description');
    var $buttonBlock = $checkoutBox.find('.kkb_button-next-line');
    var $buttonNext = $buttonBlock.children('.kkb_button-next');
    var $checkoutAddress = $('.kkb_checkout-box__address');
    var liftChecked = false;
   
    $.each($inputCheck,function (){ 
        var parent = $(this).parent();
        if (!liftChecked) {
            if (!$('.itc_courier_delivery').hasClass('kkb_hidden')) {
                if ($('.kkb-input-lift').hasClass('is_required') && !$('.kkb-input-lift').val() && $('.kkb-input-lift').length) {
                    var liftError = true;
                    $('.kkb_select-block_lift').addClass('kkb_error-border_active');
                    $('.kkb_select-block_lift').closest('.kkb_item-element').find('.kkb_error-info').addClass('kkb_error-info_active');
                    $error = true;
                }
            }
        }
        if ($(this).val().length === 0 || ($(this).hasClass('itc_error'))){
            $(this).addClass('kkb_error-border_active');
            //$(this).closest('.kkb_item-element').find('.kkb_select-block').addClass('kkb_error-border_active');
            $(this).closest('.kkb_item-element').find('.kkb_error-info').addClass('kkb_error-info_active');
            if ($(this).hasClass('kkb_table-dataTime')){
                $(this).next().addClass('kkb_error-border_active');
            }
            var $thisButtonNext = $(this).closest('.kkb_checkout__content').next().children('.kkb_button-next');
            if ($thisButtonNext.hasClass('kkb_button-next_mobile')){
                $thisButtonNext.addClass('kkb_button_animation');
                setTimeout(function () {
                    // $('html, body').animate({
                    //     scrollTop: $this.offset().top - 200
                    // }, 600);
                    $thisButtonNext.removeClass('kkb_button_animation');
                },500);
            }
            $error = true;
        }
    });
    if (!$error){
        if ($checkoutBox.find('.kkb_checkout__content').hasClass('kkb_checkout__content_delivery')){
            var $checkoutBoxTitle = $checkoutBox.find('.kkb_checkout-box__title-main');
            var $checkoutTitle = $checkoutBoxTitle.children('.checkout_title');
            if (!$checkoutBox.find('.kkb_step-3').hasClass('kkb_hidden') && $('.kkb_step-3').length) {
                var $buttonTitle = $checkoutBox.find('.kkb_step-3').children('.kkb_step__title').text();
                $checkoutTitle.text($buttonTitle)
            } else {
                var $activeButtonStep = $checkoutBox.find('.kkb_checkout__button_active');
                $.each($activeButtonStep,function () {
                    var $buttonTitle = $(this).find('.kkb_checkout__title').text();
                    $checkoutTitle.text($buttonTitle);
                    var $priceDelivery = $(this).find('.kbb_checkout__price').text().trim();
                    $checkoutBox.find('.kkb_checkout-box__delivery-price').text($priceDelivery);
                });
            }
        }
        var $stepBox = $checkoutBox.find('.kkb_step-box_info');
        var $address = [];

        if (self.params['COURIER_ID'] != $('.kkb_checkout__button_active.itc_delivery_button').data('deliveryid')) {
            var deliveryData = $('.kkb_checkout__button_active .itc_delivery_date');
            $('#itc_delivery_date').html(deliveryData);
        } else {
            $('#itc_delivery_date').text('');
        }
        
        $infoBox.find('.kkb_info-line-template').remove();
        $.each($stepBox,function () {
            if (!$(this).hasClass('kkb_hidden')){
                $.each($(this).find('.kkb_block-input'),function () {
                    if ($(this).hasClass('kkb_record-separately')) {
                        if ($(this).val().length > 0){
                            if ($(this).hasClass('kkb-input-full-address')){
                                $address.push(' ' + $(this).val()+'');
                            }
                            if ($(this).hasClass('kkb_input-numberHome')){
                                $address.push(' кв./оф. '+$(this).val()+'');
                            }
                            if ($(this).hasClass('kkb-input-porch')){
                                $address.push(' под. '+$(this).val()+'');
                            }
                            if ($(this).hasClass('kkb-input-floor')) {
                                $address.push(' этаж '+$(this).val());
                            }
                            if ($(this).hasClass('kkb-input-lift')){
                                var $liftText;
                                if ($(this).val() === 'Да'){
                                    $liftText = ' лифт есть';
                                    $address.push($liftText);
                                }
                            }
                            if ($(this).hasClass('kkb-input-city') && $address.length == 0) {
                                $address.push($(this).val());
                            }
                        }                        
                        $checkoutAddress.text($address);
                        $('.checkout_title').html($('.kkb_checkout__button_active .kkb_checkout__title').html());
                    } else {
                        if (!$(this).hasClass('kkb_block-input-add')) {
                            if ($(this).val().length > 0) {
                                if (!$(this).hasClass('passport-data')){
                                    var $thisVal = $(this).attr('value') ? $(this).attr('value') : $(this).val();
                                    var $thisTitle = $(this).closest('.kkb_item-element').find('.kkb_item-element__title').text();
                                    if ($(this).hasClass('kkb_block-textarea') && $(this).val().length > 35) {
                                        var text = $(this).val().substring(0, 35);
                                        var lastIndex = text.lastIndexOf('');
                                        text = text.substring(0, lastIndex) + '...';
                                        $thisVal = text;
                                    }
                                    
                                    var $template =
                                    '<div class="kkb_checkout-box__info-line kkb_info-line-template">' +
                                    '<div class="kkb_checkout-box__info-title">' + $thisTitle + '</div>' +
                                    '<div class="kkb_checkout-box__info-text">' + $thisVal + '</div>' +
                                    '</div>';
                                    $infoBox.append($template);
                                }
                            }
                        } else {
                            self.addRecipient();
                        }
                    }
                });
                var $passportData = [];
                var $thisTitle = $(this).find('.passport-data').closest('.kkb_block-item__line').prev().children().text();
                $.each($(this).find('.passport-data'),function () {
                    $passportData.push(' ' +$(this).attr('placeholder')+ ' : ' +$(this).val()+ ' ');
                });
                var $template =
                '<div class="kkb_checkout-box__info-line kkb_info-line-template">' +
                '<div class="kkb_checkout-box__info-title">' + $thisTitle + '</div>' +
                '<div class="kkb_checkout-box__info-text">' + $passportData + '</div>' +
                '</div>';
                $infoBox.append($template);
            }
        });
        $buttonBlock.slideUp(500);
        $buttonNext.text('Сохранить');
        if ($buttonNext.hasClass('kkb_button-next_save')){
            $buttonNext.removeClass('kkb_button-next_save');
            $('.kkb_error-button').removeClass('kkb_error-button_active');
        }
        var BoxSlideUp = $this;
        if ($this.hasClass('kkb_step-box')){
            BoxSlideUp = $this.closest('.kkb_checkout__content');
        }
        if (!$checkoutBox.hasClass('readyForChange')){
            BoxSlideUp.slideUp(500, function () {
                $checkoutBox.addClass('readyForChange');
                $buttonChange.removeClass('kkb_change-checkout_blocked');
                $infoBox.slideDown(500).animate({'opacity' : '1'},300);
                var $nextBlock = $checkoutBox.next().find('.kkb_checkout__content');
                if ($nextBlock.length >= 1) {
                    setTimeout(function () {
                        $nextBlock.slideDown(500,function () {
                            $checkoutBox.next().addClass('kkb_checkout-box_active');
                            $checkoutBox.next().children('.kkb_checkout-box__title').addClass('kkb_checkout-box__title_active');
                            $nextBlock.next().slideDown(500);
                        });
                        $('.kkb_checkout__button-delivery').each(function(){
                            if ($(this)[0].scrollHeight < 40 && $(this)[0].scrollHeight > 0) {
                                $(this).parent().children('.kkb_checkout__button-delivery__hidden').remove();
                            }
                        })
                    },500); 
                    var nextMobileButton = $nextBlock.next().children('.kkb_button-next');
                    if (nextMobileButton.hasClass('kkb_button-next_mobile')){
                        $('html, body').animate({
                            scrollTop: $checkoutBox.offset().top -30                                
                        }, 600);
                    }
                } else {         
                    var $checkoutButton = $('.kkb_checkout-button');
                        setTimeout(function () {
                            $checkoutButton.text('Завершить оформление');
                            if ($('.kkb_regulations__checkbox').hasClass('kkb_regulations__checkbox_active')) {
                                $checkoutButton.removeClass('kkb_checkout-button_blocked');
                            }
                            $checkoutButton.addClass('kkb_checkout-button_complete');
                        },400);
                    if ($checkoutButton.hasClass('kkb_checkout-button_mobile')) {
                        $('html, body').animate({
                            scrollTop: $checkoutButton.offset().top - 250
                        }, 600);
                        setTimeout(function () {
                            $checkoutButton.addClass('kkb_button_animation');
                        },650)
                    }
                }
            });
        } else {
            var allowOrder = true;
            $checkoutBox.find('.kkb_checkout__content').slideUp(500);
            $.each($('.kkb_checkout-box'),function () {
                if (!$(this).hasClass('readyForChange')){
                    $(this).find('.kkb_checkout__content').slideDown(500);
                    $(this).find('.kkb_button-next-line').slideDown(500);
                    allowOrder = false;
                    return false;
                }
            });
            if (allowOrder) {
                var $checkoutButton = $('.kkb_checkout-button');
                    setTimeout(function () {
                        $checkoutButton.text('Завершить оформление');
                        if ($('.kkb_regulations__checkbox').hasClass('kkb_regulations__checkbox_active')) {
                            $checkoutButton.removeClass('kkb_checkout-button_blocked');
                        }
                        $checkoutButton.addClass('kkb_checkout-button_complete');
                    },400);
                if ($checkoutButton.hasClass('kkb_checkout-button_mobile')) {
                    $('html, body').animate({
                        scrollTop: $checkoutButton.offset().top - 250
                    }, 600);
                    setTimeout(function () {
                        $checkoutButton.addClass('kkb_button_animation');
                    },650)
                }
            }
        }
    }
}

orderController.prototype.registerNextButtonHandler = function() {
    var self = this;
    $(document).off('click', '.kkb_button-next');
	$(document).on("click", ".kkb_button-next", function(e) {
        e.preventDefault();
        $('.delivery-error-box').html('');
        var checkoutContent = $(this).parent().prev();
        if (checkoutContent.hasClass('kkb_checkout__content_delivery')){
            var $stepBox = checkoutContent.find('.kkb_step-box');
            $.each($stepBox,function () {
                if (!$(this).hasClass('kkb_hidden')){
                   var $this = $(this);
                   self.nextStep($this);
                }
            });
        } else if (checkoutContent.hasClass('kkb_checkout__content_сontacts')) {
            var $this = checkoutContent;
            self.nextStep($this);
        } else {
            var $this = checkoutContent;
            self.nextStep($this);
        }
        if ($(this).hasClass('kkb_button-next_save')){
            checkoutContent.closest('.kkb_checkout-box').find('.kkb_change-checkout').removeClass('kkb_change-checkout_active')
        }
    });
}

orderController.prototype.registerChangeCheckoutHandler = function() {
    $(document).off('click', '.kkb_change-checkout');
	$(document).on("click", ".kkb_change-checkout", function(e) {
        e.preventDefault();
        $('.itc-delivery-next').show();
        if ($(this).hasClass('delivery-change')) {
            $('#order-delivery-info').hide();
        }
        if ($(this).hasClass('contacts-change')) {
            $('#order-contacts-info').hide();
        }
        var checkoutBox = $(this).closest('.kkb_checkout-box');
        var buttonNext = checkoutBox.find('.kkb_button-next-line').children('.kkb_button-next');
        if (!$('.kkb_button-next').hasClass('kkb_button-next_save')) {
            buttonNext.addClass('kkb_button-next_save');
            $('.kkb_checkout__content').slideUp(500);
            $('.kkb_button-next-line').slideUp(500);
            checkoutBox.find('.kkb_checkout__content').slideDown(500);
            checkoutBox.find('.kkb_button-next-line').slideDown(400);
            $('.kkb_block-input_check').each(function(){
                if (!$(this).hasClass('itc_error')) {
                    $(this).removeClass('kkb_error-border_active');
                }
            });
            //$('.kkb_block-input_check').removeClass('kkb_error-border_active');
            $('.kkb_error-info').removeClass('kkb_error-info_active');
        } else {
            var $errorButton = $('.kkb_button-next_save').parent().find('.kkb_error-button');
            $errorButton.removeClass('kkb_error-button_active');
            setTimeout(function () {
                $errorButton.addClass('kkb_error-button_active');
            },200);
            if (checkoutBox.find('.kkb_button-next-line').css('display') === 'block' && buttonNext.hasClass('kkb_button-next_mobile')){
                $('html, body').animate({
                    scrollTop: buttonNext.offset().top - 250
                }, 600);
            }
        }
    });
    $(document).off('click', '.kkb_checkout__button-desktop:not(.itc_delivery_button),.kkb_checkout__button-mobile');
	$(document).on("click", ".kkb_checkout__button-desktop:not(.itc_delivery_button),.kkb_checkout__button-mobile", function(e) {
        $('.kkb_checkout__button').removeClass('kkb_checkout__button_active');
        var $stepNumber = $(this).attr('data-step');
        var $checkoutButton = $('.kkb_checkout__button[data-step="'+ $stepNumber +'"]');
        $checkoutButton.addClass('kkb_checkout__button_active');
        $('.kbb_checkout__price').removeClass('kbb_checkout__price_show');
        $checkoutButton.find('.kbb_checkout__price').addClass('kbb_checkout__price_show');
        var $boxStep = '.kkb_step-'+$stepNumber+'';
        $('.kkb_step-box').addClass('kkb_hidden');
        $($boxStep).removeClass('kkb_hidden');
        var checkoutBox =  $(this).closest('.kkb_checkout-box');
        checkoutBox.find('.kkb_block-input_check:not(.itc_error)').removeClass('kkb_error-border_active');
        checkoutBox.find('.kkb_error-info').removeClass('kkb_error-info_active');
        $('.kkb_item-element_date').removeClass('kkb_error-border_active');
    });
}

orderController.prototype.valStreetAndCity = function($city,$street,$inputAddress) {
    $('.kkb_store-address__item').prev().removeClass('kkb_block-input_check');
    $('.kkb_store-address__item').prev().val('');
    var $templateAddress = ''+$city+', '+$street+'';
    $inputAddress.val($templateAddress);
    $inputAddress.addClass('kkb_block-input_check');
}

orderController.prototype.activeStoreAddress = function (){
    var self = this;

    if ($('.kkb_store-address__list').length >= 1) {
        $.each($('.kkb_store-address__item'),function () {
           
            if ($(this).hasClass('kkb_store-address__item_active')) {
                var $thisCheckbox = $(this).find('.kkb_check-box__input');
                if (!$thisCheckbox.is(':checked')) {
                   $thisCheckbox.prop('checked',true);
                   $(this).children('.kkb-check-box').addClass('kkb-check-box_active');
                   var $city = $(this).attr('data-id-city');
                   var $street = $(this).find('span').text();
                   var $inputAddress = $(this).prev();
                   self.valStreetAndCity($city,$street,$inputAddress);
                }
            }
        });
    }
}

orderController.prototype.windowResize = function () {
    var $popUpButtonLine = $('.kkb_popUp-dateTime__button-line');
    var $popUpClosed = $('.kkb_popUp__closed');
    var $checkoutButton = $('.kkb_checkout-button');
    var $buttonNext = $('.kkb_button-next');
    var $infoFloor = $('.kkb_info-floor');
    if ($(window).width() < 767) {
        $popUpButtonLine.addClass('kkb_popUp-dateTime__button-line_mobile');
        $popUpClosed.addClass('kkb_popUp__closed_mobile');
        $checkoutButton.addClass('kkb_checkout-button_mobile');
        $buttonNext.addClass('kkb_button-next_mobile');
        $infoFloor.addClass('kkb_info-floor_mobile')
    } else {
        $popUpButtonLine.removeClass('kkb_popUp-dateTime__button-line_mobile');
        $popUpClosed.removeClass('kkb_popUp__closed_mobile');
        $checkoutButton.removeClass('kkb_checkout-button_mobile');
        $buttonNext.removeClass('kkb_button-next_mobile');
        $infoFloor.removeClass('.kkb_info-floor_mobile')
    }
}

orderController.prototype.registerSimplePopupHandler = function() {
    var self = this;
    $(document).off('click', '.kkb_popUp__closed');
	$(document).on('click', '.kkb_popUp__closed', function() {
        $('.kkb_popUp-dateTime').removeClass('transition_loaded');
        $('.kkb_popUp-dateTime').removeClass('kkb_popUp-dateTime_active');
        $('.kkb_popUp-dateTime__box').removeClass('kkb_popUp-dateTime__box_show');
        if ($(this).hasClass('kkb_popUp__closed_mobile')){
            $('.kkb_popUp-dateTime__button-line_mobile').removeAttr('style');
        }
    });
	$(document).off('click', '.kkb_popUp-dateTime');
	$(document).on('click', '.kkb_popUp-dateTime', function(e) {
        var $popUpDataTime = $('.kkb_popUp-dateTime__box');
        if (!$popUpDataTime.is(e.target)
            && $popUpDataTime.has(e.target).length === 0){
            if ($('.kkb_popUp-dateTime').hasClass('transition_loaded')) {
                $('.kkb_popUp-dateTime').removeClass('transition_loaded');
                $('.kkb_popUp-dateTime').removeClass('kkb_popUp-dateTime_active');
                $('.kkb_popUp-dateTime__box').removeClass('kkb_popUp-dateTime__box_show');
            }
        }
    });
    $(document).off('click', '.kkb_popUp-text__closed');
	$(document).on('click', '.kkb_popUp-text__closed', function(e) {
        self.popUpTextNotActive();
    });
    $('.kkb_popUp-dateTime__button').hover(function () {
       if ($(this).hasClass('kkb_popUp-dateTime__button_active')){
           $(this).addClass('kkb_popUp-dateTime__button_hover');
       }
    },function () {
        $(this).removeClass('kkb_popUp-dateTime__button_hover');
    });
}

orderController.prototype.popUpTextNotActive = function() {
    $('.kkb_popUp-text').removeClass('kkb_popUp-text_active');
    $('body').removeClass('kkb_no-scroll');
    $('.kkb_popUp-text').children('.kkb_popUp-text__box').removeClass('kkb_popUp-text__box_show');
}

orderController.prototype.inputListShow = function($thisInput){
    var $blockInputList = $thisInput.next('.kkb_block-input-list');
    if($thisInput.next('.kkb_block-input-list').length >= 1){
        if ($.trim($thisInput.val()).length > 0){
            $blockInputList.addClass('kkb_block-input-list_show');
        } else {
            $blockInputList.removeClass('kkb_block-input-list_show');
        }
    }
}

orderController.prototype.registerMiscHandlers = function() {
    var self = this;
    $(document).off('click', '.kkb_block-input-list__item');
	$(document).on('click', '.kkb_block-input-list__item', function(e) {
        var $input = $(this).parent().prev();
        $input.val($(this).text());
        $input.addClass('kkb_choice');
        $('.kkb_block-input-list').removeClass('kkb_block-input-list_show');
    });
    $(document).off('input', '.kkb_block-input');
	$(document).on('input', '.kkb_block-input', function(e) {
        var $thisInput = $(this);
        if ($(this).next().length >= 1){
            self.inputListShow($thisInput);
            //$(this).removeClass('kkb_choice');
        }
    });
    $(document).off('focusout', '.kkb_block-input');
	$(document).on('focusout', '.kkb_block-input', function(e) {
        var $this = $(this);
        setTimeout(function () {
            $this.next().removeClass('kkb_block-input-list_show');
            //if (!$this.hasClass('kkb_choice') && $this.next('.kkb_block-input-list').length > 0){
            //    $this.val('');
            //}
        },150);
        setTimeout(function(){
            if($this.hasClass('kkb-input-floor')){
                $('.kkb_checkout-button').addClass('kkb_checkout-button_blocked');
            }
        },600)

    });
    $(document).off('input', '.kkb_block-input[type="number"],.kkb_basket-number__input');
	$(document).on('input', '.kkb_block-input[type="number"],.kkb_basket-number__input', function(e) {
        var $thiVal = $(this).val().replace(/[^0-9]/g, '');
        $(this).val($thiVal);
    });
    $(document).off('click', '.kkb_basket__item-info-closed');
	$(document).on('click', '.kkb_basket__item-info-closed', function(e) {
        var basketInfo = $(this).parent();
        basketInfo.addClass('kkb_basket__item-info_blockade');
        if (basketInfo.hasClass('kkb_basket__item-info_blockade')){
            setTimeout(function () {
                basketInfo.removeClass('kkb_basket__item-info_active');
                basketInfo.removeClass('kkb_basket__item-info_blockade');
            },220)
        }
    });
}

orderController.prototype.miscReadyActions = function() {
    var self = this;
    $(document).ready(function () {
        self.inputCheck();
        self.inititalMiscActions();
        self.activeStoreAddress();
        self.updateFloorLiftRelation($('.kkb-input-floor').val(), $('.kkb-input-lift').val());
        var $selectDelivery = $('.kkb_select-block_delivery');
        $selectDelivery.children('input').val($selectDelivery.children('.kkb_select-block__title').text());
        var $width = $(this).width();
        $(window).resize(function(){
            $width = $(this).width();
            self.windowResize();
        });
        self.windowResize();
        (function () {
            var $checkoutContent = $('.kkb_checkout__content');
            if ($checkoutContent.length >= 1){
                $.each($checkoutContent,function () {
                    if ($(this).hasClass('company-delivery')){
                        $('.kkb_step-3').removeClass('kkb_hidden');
                        var $stepBox = $(this).find('.kkb_step-box');
                        $.each($stepBox,function (index) {
                            if (!$(this).hasClass('kkb_hidden') && index !== 2){
                                $(this).addClass('kkb_hidden');
                            }
                        });
                    }
                });
            }
        }());
        (function () {
            $(document).mouseup(function (e){
                var popUpBox = $('.kkb_popUp-text__box');
                if (!popUpBox.is(e.target)
                    && popUpBox.has(e.target).length === 0){
                    self.popUpTextNotActive();
                }
            });
        }());
        var paymentTitle = $('.itc_payment_title');
        if (paymentTitle.length) {
            // $('.itc_payment_title').html($('.itc_payment_title').html().trim()[0].toLowerCase() + $('.itc_payment_title').html().trim().slice(1));	
        }
    });
}

