	this.registerDeleteHandler();
	this.registerFavoriteHandler();
	this.registerPaymentHandler();
	this.registerDeliveryHandler();
	this.registerStoreHandler();
	this.registerOrderHandler();
	this.registerLiftHandler();
	this.registerFloorHandler();
	this.registerTKHandler();
	this.registerHouseHandler();
	this.registerSimpleHandler();
	this.registerProductAssemblyHandler();
