function initDropdown(event, data) {
	event.stopPropagation();
	var self = $(this),
		eventType = data != undefined && data ? "hover" : "click",
		classBody = "has-dropdown-open" + (self.hasClass("catalog-menu") ? ' has-dropdown-open-md' : '');
		classBody += self.hasClass("sidebar-popup") || self.hasClass("location-dropdown") || self.hasClass("office-dropdown") ? ' has-dropdown-open-sm' : '';
	if (data != undefined && data) {
		$("> .dropdown__button, > .dropdown__head .dropdown__button, > .dropdown__close, > .dropdown__head .dropdown__close", self).on("mouseenter.dropdown click.dropdown", function(event) {
			event.stopPropagation();
			event.stopImmediatePropagation();

			if ((event.type == "mouseenter") && isMobile) {
				return;
			};
			if (!self.hasClass("open")) {
				event.preventDefault();
			};
			$(document).trigger("click.selectStyler");
			if ($(this).hasClass("dropdown__close")) {
				$(".dropdown.js-dropdown.open, .dropdown.js-dropdown-hover.open").not(self.data("arrParent")).trigger("closeDropdown");
			} else {
				$(".dropdown.js-dropdown.open, .dropdown.js-dropdown-hover.open").not(self).not(self.data("arrParent")).trigger("closeDropdown");
				if (event.type == "touchend") {
					self.toggleClass("open");
				} else {
					self.addClass("open");
				}
			};
			if($(".dropdown.open").length > 0) {
				$("html").addClass(classBody);
			} else {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};
			if ($(self).hasClass("no-body-fixed")) {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};
		});
		if(isMobile) {
			$(self).on("mouseleave.dropdown", function(event) {
				event.stopPropagation();
				event.stopImmediatePropagation();
				if (!self.hasClass("open")) {
					event.preventDefault();
				};
				$(document).trigger("click.selectStyler");
				if ($(this).hasClass("dropdown__close")) {
					$(".dropdown.js-dropdown.open").not(self.data("arrParent")).trigger("closeDropdown");
				} else {
					$(".dropdown.js-dropdown.open").not(self).not(self.data("arrParent")).trigger("closeDropdown");
					self.removeClass("open");
				};
				if($(".dropdown.open").length > 0) {
					$("html").addClass(classBody);
				} else {
					$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
				};
				if ($(self).hasClass("no-body-fixed")) {
					$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
				};

			});
		}
	} else {
		$("> .dropdown__button, > .dropdown__head .dropdown__button, > .dropdown__close, > .dropdown__head .dropdown__close", self).on("click.dropdown touchend.dropdown", function(event) {
			event.stopPropagation();
			event.stopImmediatePropagation();
			if (event.type == "touchend") {
				//return;
			};
			if (!self.hasClass("open")) {
				event.preventDefault();
			};
			$(document).trigger("click.selectStyler");
			if ($(this).hasClass("dropdown__close")) {
				$(".dropdown.js-dropdown.open").not(self.data("arrParent")).trigger("closeDropdown");
			} else {
				$(".dropdown.js-dropdown.open").not(self).not(self.data("arrParent")).trigger("closeDropdown");
				self.toggleClass("open");
			};
			if($(".dropdown.open").length > 0) {
				$("html").addClass(classBody);
			} else {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};
			if ($(self).hasClass("no-body-fixed")) {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};
		});
	};
	$(self).on("click.dropdown touchend.dropdown", function(event) {
		//event.stopPropagation();
		$(".dropdown", this).trigger("closeDropdown");
	});
	$(self).on("closeDropdown", function(event, e) {
		if (e == undefined || !$(self).has(e.target).length) {
			event.stopPropagation();
			$(this).removeClass("open");
			if($(".dropdown.open").length > 0) {
				$("html").addClass(classBody);
			} else {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};

			if ($(self).hasClass("no-body-fixed")) {
				$("html").removeClass("has-dropdown-open has-dropdown-open-md has-dropdown-open-sm has-dropdown-open-xs has-dropdown-open-lg");
			};
		};
	});
	if($(self).data("arrParent") === undefined) {
		$(self).data("arrParent", $([]));
	};
	$(".dropdown", self).each(function() {
		if($(this).data("arrParent") != undefined) {
			var arrParent = $(this).data("arrParent");
			$(this).data("arrParent", arrParent.add(self));
		} else {
			$(this).data("arrParent", $(self));
		};
	});
};
/*-----------------------------collapse-block---------------------------------*/
function initCollapse(event) {
	event.preventDefault();
	event.stopPropagation();
	var self = $(this),
		selfButton = $("> .collapse-block__button, > .collapse-block__head .collapse-block__button", self),
		selfClose = $("> .collapse-block__close, > .collapse-block__head .collapse-block__close", self),
		selfCont = $("> .collapse-block__cont", self),
		selfContInner = $("> .collapse-block__cont-inner", selfCont),
		duration = selfCont.css("transition-duration") != undefined ? parseFloat(selfCont.css("transition-duration"), 10) : 0,
		transitionEnd = 'transitionend webkitTransitionEnd oTransitionEnd otransitionend update',
		eventType = isMobile ? "touchend" : "click",
		onlyOne = self.data("onlyone") != undefined ? true : false,
		closeChild = self.data("closechild") != undefined ? true : false,
		minHeight = self.data("minheight") != undefined ? parseInt(self.data("minheight"), 10) : 1,
		ignore = false;


	if (self.data("collapseInited") != undefined) { return; };
	self.data("collapseInited", true);

	selfButton.off("touchstart touchmove").on("touchstart touchmove", function(event) {
		if (event.type == "touchstart") { ignore = false; } else { ignore = true; };
	});
	selfButton.off(eventType).on(eventType, function(event) {
		event.preventDefault();
		event.stopPropagation();
		event.stopImmediatePropagation();
		if (!ignore) {
			if(selfCont.hasClass("in")) {
				self.trigger("collapse");
			} else {
				if(Modernizr.csstransitions) {
					selfCont.removeClass("collapse");
					selfCont.addClass("in").height(minHeight+"px").addClass("collapsing").height((selfContInner.length ? selfContInner.height() : selfCont[0].scrollHeight));
					self.removeClass("out").addClass("in");
					if (onlyOne) {
						self.siblings(".collapse-block").trigger("collapse");
					};
				} else {
					if (onlyOne) {
						self.siblings(".collapse-block").trigger("collapse");
					};
					selfCont.slideDown(duration, function() { selfCont.trigger("update"); });
				};
			};
		};
	});
	selfClose.off(eventType).on(eventType, function(event) {
		self.trigger("collapse", true);
	});
	$(self).off("collapse").on("collapse", function(event, data) {
		event.preventDefault();
		event.stopPropagation();
		var thisOnly = data != undefined ? data : false;
		if(selfCont.hasClass("in")) {
			selfCont.removeClass("collapse");
			if(Modernizr.csstransitions) {
				selfCont.height((selfContInner.length ? selfContInner.height() : selfCont[0].scrollHeight));
				selfCont.addClass("collapsing").removeClass("in").height(minHeight+"px");
			} else {
				selfCont.slideUp(duration, function() {selfCont.trigger("update");});
			};
		};
		if (!thisOnly && closeChild) {
			$(".collapse-block.in", self).trigger("collapse", true);
		};
	});
	selfCont.off(transitionEnd).on(transitionEnd, function(event) {
		if (selfCont.is(event.target)) {
			selfCont.removeClass("collapsing").addClass("collapse");
			if(selfCont.hasClass("in")) {
				selfCont.height("");
				self.removeClass("out").addClass("in");
				self.trigger("collapseOpen");
			} else {
				self.removeClass("in").addClass("out");
				self.trigger("collapseClose");
			};
		};
	});
	$(self).off("update").on("update", function(event) {
		//minHeight = selfCont.css("max-height") != undefined && !isNaN(parseInt(selfCont.css("max-height"), 10)) ? parseInt(selfCont.css("max-height"), 10) : 1;
		if (selfContInner.length && minHeight > 1) {
			if (minHeight < selfContInner.height()) {
				selfCont.height(minHeight+"px");
				self.add(selfCont).addClass("out").removeClass("in");
				self.addClass("show-head");
			} else {
				selfCont.height('');
				self.add(selfCont).removeClass("out").addClass("in");
				self.removeClass("show-head");
			};
		};
	});
	if (selfCont.hasClass("out")) {
		self.addClass("out");
		selfCont.height(minHeight+"px");
		if (minHeight < (selfContInner.length ? selfContInner.height() : selfCont[0].scrollHeight)) {
			//self.add(selfCont).removeClass("out").addClass("in");
		};
	} else if (selfCont.hasClass("in")) {
		self.addClass("in");
	};
	var updateTimeOut = null;
	$(window).on("resize", function() {
		if (updateTimeOut != undefined && updateTimeOut != null) {
			clearTimeout(updateTimeOut);
		};
		updateTimeOut = setTimeout(function() { $(self).trigger("update"); }, 100);
	});
};
