function initializeLazyLoad(lazyClass) {

    if (!lazyClass) {
        lazyClass = 'itc-lazy-load'; 
    }

	$('.' + lazyClass).Lazy({
		scrollDirection: 'vertical',
		effect: 'fadeIn',
		bind: "event",
		effectTime: 100,
		threshold: 350,
		afterLoad: function(element) {
            $(element).removeClass('itc-lazy-load-hidden');    
			if ($(element).hasClass("itc-lazy-resize-posteffect")) {
				setTimeout(function() { 
					$(element).removeClass('itc-lazy-load');
				}, 500);
			}
			if ($(element).hasClass("itc-lazy-resize-trigger")) {
				 $('body').trigger("resize");
			}
		},
        onError: function(element) {
           $(element).removeClass('itc-lazy-load-hidden');    
        },
	});
	
}

$(function() {
	
	if (isMobile) {
		
		$('body').on('scroll',function(e) {
			initializeLazyLoad();     
		});
		
	}
});

