function getCatalogRating()
{
    var elementsIDs = [];
    $('.kkb_content-item__rating-box:not(.load)').each(function(index, el) {
        var elementId = $(el).parents('.kkb_content-item__link').data('productid');
        elementsIDs[elementId] = elementId;
    });
    
    if (elementsIDs.length > 0) {
        BX.ajax({
            url: '/ajax/catalog.section/getReviewsByList.php',
            method: 'POST',
            dataType: 'json',
            data: {ELEMENTS_IDS: elementsIDs, sessid: BX.message('bitrix_sessid')},
            onsuccess: function(response) {
                if (response) {
                    for (var i in response) {
                        var item = response[i],
                            $rating = $('#rating_' + item.ID),
                            star = '<div class="kkb_content-item__rating-star"></div>';
                        if ($rating.length) {
                            if (item.VALUE) {
                                $rating.html('<span>' + item.VALUE.toFixed(1) + '</span>');
                                $rating.append(star);
                            }
                            $rating.addClass('load');
                        }
                    }
                }
            }
        });
    }
}


function actualStateItems(clickedItem) {
	
   // var lineBlockClone = $('.kkb_button-line').clone();
   // console.log(lineBlockClone);
    var hasOffers = $('#kkb_info-prod').data('offers') == 'Y';
    var storeAvaialble = $('#kkb_info-prod').data('store') == 'Y';
    var productid = $('#kkb_info-prod').data('productid');
    var offerid = false;
    
    var absentOfferId = false;

    if (typeof clickedItem == 'object' && clickedItem.hasClass('kkb_popup-size__list-item_not')) {
        $('#itc_add_basket_card').css({'display':'none'});
        $('.kkb_mobile__button-cart').css({'display':'none'});
        
        if (!clickedItem.hasClass('itc_in_basket')) {
            $('.ksk_text_info--noTovar').css({'display':'block'});
        }
   
        absentOfferId = clickedItem.data('offerid'); 
    } else if(typeof clickedItem == 'object') {
       
        $('.ksk_text_info--noTovar').css({'display':'none'});
    }
    
    if (typeof clickedItem == 'object' && clickedItem.hasClass('itc_in_basket')) {
        $('.ksk_text_info--noTovar').css({'display':'none'});
        $('#itc_in_basket_card').addClass('kkb_button-cart_active').show();
        $('.kkb_mobile__button_go-basket').show();
    }

	$.ajax({
		url: '/ajax/itconstruct/getBasketJson.php',
		type: 'POST',
		dataType: 'json',
		data: {sessid: BX.message('bitrix_sessid')},
		success: function(response) {
            
			$('.kkb_content-item__icon_cart').removeClass('kkb_content-item__icon_active');
			$('.kkb_content-item__icon_heart, .itc_wish_item_detail').removeClass('kkb_content-item__icon_active');
			$('.kkb_button-icon-box__item_heart').removeClass('kkb_button-icon-box__item_active');
			$('.itc_wish_item_detail').removeClass('kkb_button-icon-box__item_active');
			$('.kkb_content-item__icon_comparison, .itc_compare_item_detail').removeClass('kkb_content-item__icon_comparison_active');
			$('.itc_compare_item_detail').removeClass('kkb_button-icon-box__item_comparison_active');
			if (typeof response !== 'undefined') {
				if (typeof response.BASKET !== 'undefined') {
					for (var i in response.BASKET) {
						var id = response.BASKET[i];
                        $('#itc-offer-' + id).addClass('itc_in_basket');
						$('.kkb_content-item__icon_cart[data-item=' + id + ']').addClass('kkb_content-item__icon_active');
						$('#itc_add_basket_card[data-item=' + id + ']').hide();
						$('.kkb_mobile__button-cart[data-item=' + id + ']').hide();
						$('.kkb_button__length__container').css({'display':'flex'});

                        if (clickedItem) {
                            offerid = clickedItem.attr('data-offerid');
                        }
                        
                        if (storeAvaialble && response.BASKET[offerid]) {
                            $('.ksk_text_info--noTovar').css({'display':'none'});
                            $('#itc_in_basket_card[data-item=' + offerid + ']').addClass('kkb_button-cart_active').show();
                            $('.kkb_mobile__button_go-basket[data-item=' + offerid + ']').show();
                        } else if (!hasOffers) {
                            if (storeAvaialble) {
                                if(!$('.ksk_text_info--noTovar').hasClass('itc_absent') || response.BASKET[productid]) {
                                    $('.ksk_text_info--noTovar').css({'display':'none'});
                                }
                                $('#itc_in_basket_card[data-item=' + id + ']').addClass('kkb_button-cart_active').show();
                                $('.kkb_mobile__button_go-basket[data-item=' + id + ']').show();
                            }
                        }
   
					}
				}
                                
                if (hasOffers) {
                    if (typeof clickedItem == 'object') {
                        var offerid = clickedItem.data('id');
                        if (clickedItem.hasClass('kkb_popup-size__list-item_not')) {
                            $('.ksk_text_info--noTovar').addClass('itc_absent');
                        } else {
                            $('.ksk_text_info--noTovar').removeClass('itc_absent');
                        }
                    }
                }
                 
                if (typeof clickedItem == 'object') {
                    if (!clickedItem.hasClass('kkb_popup-size__list-item_not')) {
                        var offerid = clickedItem.data('id');
                        if(response.BASKET[offerid]) {
                            $('.to-basket-add-popup').hide();
                            $('.to-basket-go-popup').show();
                        } else {
                            $('.to-basket-add-popup').show();
                            $('.to-basket-go-popup').hide();
                        }
                    }
                } 
                
				if (typeof response.DELAY !== 'undefined') {
                    if (typeof clickedItem == 'object' && $('.kkb_popupSize').hasClass('itc_wish_popup')) {
                        var offerid = clickedItem.data('id');
                           
                        if (response.DELAY[offerid]) {
                            $('.to-basket-add-popup').hide();
                            $('.to-basket-go-popup').show();
                        } else {
                            $('.to-basket-add-popup').show();
                            $('.to-basket-go-popup').hide();
                        }
                    }
					for (var i in response.DELAY) {
						var id = response.DELAY[i];
                        if (hasOffers) {
                            
                            var isAbsentOffer = $('.kkb_popup-size__list-item_not[data-offerid='+id+']').length;
                            
                            $('.kkb_mobile__button_go-basket[data-offerid=' + id + ']').hide();
                            $('.kkb_button_go-basket[data-offerid=' + id + ']').hide();
                            if (!isAbsentOffer) {
                                $('.kkb_mobile__button-cart[data-offerid=' + id + ']').show();
                                $('.kkb_button-cart-prod.to-cart[data-offerid=' + id + ']').show();
                            }
                        } else {
                            $('.kkb_mobile__button_go-basket[data-item=' + id + ']').hide();
                            $('.kkb_mobile__button-cart[data-item=' + id + ']').show();
                            $('.kkb_button_go-basket[data-item=' + id + ']').hide();
                            $('.kkb_button-cart-prod.to-cart[data-item=' + id + ']').show();
                        }
  
						$('.kkb_content-item__icon_heart[data-item=' + id + ']').addClass('kkb_content-item__icon_active');
						$('.kkb_button-icon-box__item_heart[data-item=' + id + ']').addClass('kkb_button-icon-box__item_active');
                        $('.kkb_content-item__icon_heart[data-productid=' + id + ']').addClass('kkb_content-item__icon_active');
						$('.kkb_button-icon-box__item_heart[data-productid=' + id + ']').addClass('kkb_button-icon-box__item_active');
						$('.itc_wish_item_detail[data-item=' + id + ']').addClass('kkb_button-icon-box__item_active');
					}
				}
          
				if (typeof response.COMPARE !== 'undefined') {
                   
                    if (typeof clickedItem == 'object' && $('.kkb_popupSize').hasClass('itc_compare_popup')) {
                        
                        var offerid = clickedItem.data('id');
                         
                        if (response.COMPARE[offerid]) {
                            $('.to-basket-add-popup').hide();
                            $('.to-basket-go-popup').show();
                        } else {
                            $('.to-basket-add-popup').show();
                            $('.to-basket-go-popup').hide();
                        }
                    }
					for (var i in response.COMPARE) {
						var id = response.COMPARE[i];
						$('.kkb_content-item__icon_comparison[data-item=' + id + ']').addClass('kkb_content-item__icon_comparison_active');
                        $('.kkb_content-item__icon_comparison[data-productid=' + id + ']').addClass('kkb_content-item__icon_comparison_active');
						$('.itc_compare_item_detail[data-item=' + id + ']').addClass('kkb_button-icon-box__item_comparison_active');
					}
				}
			}
            
            $('.kkb_button-line').show();
            //$('.kkb_mobile-panel-buy').show();
		}
	});
}

