function isSelectedProduct() {
	var $productLabel = $('.catalog_detail .kkb_popup-size__list .kkb_popup-size__list-item');

	if ($productLabel.length == 0) {
		return true;
	}

	return $productLabel.hasClass('kkb_popup-size__list-item_active');
}

function selectProduct() {
    
	if ($('.catalog_detail .kkb_popup-size__list-item.js-selected').length) {
		$('.catalog_detail .kkb_popup-size__list-item.js-selected').click();
       
	} else if (!isSelectedProduct()) {
       
		var $firstActiveProduct = $('.catalog_detail .kkb_popup-size__list-item:not(.kkb_popup-size__list-item_not):first');
		if ($firstActiveProduct.length) {
			$firstActiveProduct.click();
			$firstActiveProduct.removeClass('kkb_popup-size__list-item_active');
		} else {
			$('.catalog_detail .kkb_popup-size__list-item:first').click();
			$('.catalog_detail .kkb_popup-size__list-item:first').removeClass('kkb_popup-size__list-item_active');
		}
	}
}

function animateNeedSelectProduct() {
	var $productLabel = $('.catalog_detail .kkb_popup-size__list .kkb_popup-size__list-item:not(.kkb_popup-size__list-item_not)');

	if ($productLabel.length == 0) {
		return true;
	}

	if ($productLabel.hasClass('blink')) {
		return false;
	}

	// $('.kkb_popup-size__list').animate({
	// 	scrollTop: $('.kkb_popup-size__list').offset().top
	// }, 800);
	var $scrollLink = $('.kkb_button-line');
	if(!mediaMinWidth_768.matches) {
		$('html, body').animate({scrollTop: $($scrollLink).offset().top - 200}, 350);
	}

	$('.kkb_size-block__title').text('Выберите размер!');
	$('.kkb_size-block__title').css({'color': '#E42426', 'font-weight': 'bold'});

	$productLabel.addClass('blink');
	$productLabel.animate({
			'background-color': 'rgb(228, 36, 38, 0.4)',
		},
		300, function() {
			$productLabel.animate({
					'background-color': 'rgb(228, 36, 38, 0)',
				},
				200, function() {
					$productLabel.removeClass('blink');
					$productLabel.css('background-color', '');
				}
			);
		}
	);
}

