$(document).ready(function() {
	$(document).on('click', '.itc-remove', function(e) {
		e.preventDefault();
		if ( !$(this).is(".disabled") ) {
			var row = $(this).parents(".kkb_cart-item").first();
			row.fadeTo(100 , 0.05, function() {});
			delFromBasketCounter($(this).closest('.kkb_cart-item').attr('catalog-product-id'));
			reloadTopBasket('del', $('#basket_line'), 200, 2000, 'N', $(this));
			markProductRemoveBasket($(this).closest('.kkb_cart-item').attr('catalog-product-id'));
		}
	});

	var $cartClearTimer;
	var $cartBoxTimer;

	$(document)
		.on('mouseenter', '.kkb_cart-button:not(.empty)', function() {
			$cartBoxTimer = setTimeout(function() {
				$('.kkb_cart__box').addClass('kkb_cart__box_active');
				$(this).addClass('kkb_cart-button_active');
			}, 300);
			clearTimeout($cartClearTimer);
		})
		.on('mouseleave', '.kkb_cart-button:not(.empty)', function() {
			$cartClearTimer = setTimeout(function() {
				$(this).removeClass('kkb_cart-button_active');
				$('.kkb_cart__box').removeClass('kkb_cart__box_active');
			}, 250);
		});

	$(document).on('mouseenter', '.kkb_cart__box', function() {
	   clearTimeout($cartClearTimer);
	});

	$('.kkb_cart__scroll').mCustomScrollbar({
		theme: 'dark-thin',
		scrollButtons: {enable: false}
	});

	$(document).on('click', '.button--buy-icon', function() {
        setTimeout(function () {
            $('.kkb_cart__box').removeClass('kkb_cart__box_active');
        }, 1500);
    });
});

